    if (newCurrency instanceof Currency) {
      this._currency = newCurrency;
    } else {
      throw TypeError('currency must be a Currency');
    }
  }

  displayFullPrice() {
    return `${this.amount} ${this.currency.name} (${this.currency.code})`;
  }
}

